    const [test4,st4]=useState('');
    const [test5,st5]=useState('');

    
    return(
    <div className='orig'> <div className='acc'>
        
         <h2 className='qq'>Sign up</h2>
     <hr className='ww'></hr>
     <input onChange={(e)=>settest1()}  className='name' placeholder='Full name'/>
      <input className='name' placeholder='Email Adress'/>
       <input className='name' placeholder='phone number'/>
